function SentBubble({SentMessage}) {
    return (
        <div className="flex justify-start mr-2 p-1 text-base font-light">
            <div className="my-2 p-6 w-2/3 bg-gray-100 rounded-t-xl rounded-bl-xl bg-gray-300 text-white">
                <p>{SentMessage}</p>
            </div>

        </div>
    )
}

export default SentBubble;
